import React from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';
import * as RiIcons from 'react-icons/ri';
import {FaPlane, FaPlaneDeparture, FaPlaneArrival} from "react-icons/fa";
import {BiSearch, GiCommercialAirplane, MdOutlineBusinessCenter} from "react-icons/all";
import {IoMdPeople} from "react-icons/io";

export const SidebarData = [
    {
        title: 'Home',
        icon: <AiIcons.AiFillHome/>,
        path:'/',
        iconClosed: <RiIcons.RiArrowDownSFill/>,
        iconOpened: <RiIcons.RiArrowUpSFill/>,

        subNav: [
            {
                title: 'Search for employees',
                path: '/home/search-for-employee',
                icon: <BiSearch/>
            },
            {
                title: 'Search new flight',
                path: '/home/search-for-flight',
                icon: <BiSearch/>
            }
        ]
    },
    {
        title: 'Flights',
        icon: <FaPlane/>,
        iconClosed: <RiIcons.RiArrowDownSFill/>,
        iconOpened: <RiIcons.RiArrowUpSFill/>,

        subNav: [
            {
                title: 'Departure flights',
                path: '/flight/departure-flight',
                icon: <FaPlaneDeparture/>,
                cName: 'sub-nav'
            },
            {
                title: 'Arrival flights',
                path: '/flight/arrival-flight',
                icon: <FaPlaneArrival/>,
                cName: 'sub-nav'
            },
            {
                title:'Aircraft',
                path: '/flight/aircraft',
                icon: <GiCommercialAirplane/>,
                cName: 'sub-nav'
            }
        ]
    },
    {
        title: 'Clients',
        path: '/clients',
        icon: <IoMdPeople/>
    },
    {
        title: 'Companies',
        path: '/companies',
        icon: <MdOutlineBusinessCenter/>
    }
];
